/** @format */

import React from "react";
import { useDispatch } from "react-redux";
import { activateForm, activateUrl } from "../../slices/form.slice";
import CreateButton from "../create-button/create-button.component";
import {
  IntroContainer,
  NewRecipeContainer,
  ButtonContainer,
} from "./getting-started.styles";

const GettingStarted = () => {
  const dispatch = useDispatch();
  return (
    <Card className="text-center">
      <Card.Header>Getting Started</Card.Header>
      <Card.Body>
        <Card.Title>Create New Recipe</Card.Title>
        <Card.Text>
          With supporting text below as a natural lead-in to additional content.
        </Card.Text>
        <Button
          variant="outline-primary"
          onClick={() => {
            dispatch(activateForm());
            dispatch(activateUrl());
          }}
        >
          From Allrecipes.com
        </Button>
        <Button
          variant="outline-secondary"
          onClick={() => {
            dispatch(activateForm());
            dispatch(deactivateUrl());
          }}
        >
          From Scratch
        </Button>
      </Card.Body>
    </Card>
  );
};

export default GettingStarted;
